window.bookSummaryJSON = "<p><b>A magical discovery leads to a path of hope, but will the darkness be stronger than light?</b></p> <p>Celestia Rainbow never expected to find out the truth about her birth or the role she now plays in the crisis going on throughout the dimensions.</p> <p>The Forsaken are getting stronger and attacking hunters and huntresses across the dimensions out of their desire for immense power. Celestia must learn how she can help while also balancing her classes at Aslan Academy and dealing with the tension growing within her team.</p> <p>With Theo returning home, Hunter dealing with his own issues, and Cairus and Caio feeling stuck deciding whose side they're on, Celestia, Finn, and Orion have to work overtime to try and bring Team Misfit back together.</p> <p>Now that they know the identity of the mysterious man from Celestia's dreams, it's time to fight darkness with light with the help of new comrades, familiars, and a little sprinkle of glitter.</p> <p>Will Aslan's Elite unicorn shifter be able to hold onto her badass name and finally defeat the growing darkness? Or will she and her lovers finally crumble beneath their own insecurities? Only one way to find out.</p>"; 
